import React from "react";
import styled from "styled-components";

const GameTitle = styled.h1`
  justify-content: space-between;
  display: flex;
  gap: 20px;
  font-size: 72px;
  color: #fff;
  font-weight: 400;
  @media (max-width: 991px) {
    flex-wrap: wrap;
    font-size: 40px;
  }
`;

const TitleText = styled.div`
  font-family: DM Serif Display, -apple-system, Roboto, Helvetica, sans-serif;
  flex-grow: 1;
  flex-basis: auto;
  @media (max-width: 991px) {
    max-width: 100%;
    font-size: 40px;
  }
`;

const GameImage = styled.img`
  aspect-ratio: 1.01;
  object-fit: cover;
  object-position: center;
  width: 80px;
  margin: auto 0;
`;

const NavBar = () => {
  return (
    <header>
      <GameTitle>
        <TitleText>Mexican Train Dominoes</TitleText>
        <GameImage src="https://cdn.builder.io/api/v1/image/assets/TEMP/454567658b547d84431fbbdf8224a75d18594956415276dd425887318929e8c0?apiKey=7293d20271ec4f72a58fe358903b4fd6&" alt="Mexican Train Dominoes Game"/>
      </GameTitle>
    </header>
  );
};

export default NavBar;
